  \"2013-03-14T19:32:50.207180\",\n\t\"name\": \"swainsons-hawk-nests-dfg-region-2-ds696\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the spring and summer of 2009, California
  Department of Fish and Game (DFG), North Central Region (Region 2) staff surveyed
  a portion of the Sacramento Valley and Sacramento/San Joaquin Delta of California
  for nests of Swainson's hawks. We surveyed 125 randomly selected landscape blocks
  within the study area (16 percent of the study area), each measuring 5 km by 5 km,
  for all active Swainson's hawk nests. We followed methods used in the Region's previous
  Swainson's hawk monitoring (2002). These data map the active Swainson's hawk nests
  located in the 2009 survey.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
